import httpClient from "@/utils/httpclient";
export default {
    name: "shopManager",
    data () {
        return {
            tableFields: {
                phone: {
                    label: this.$t('m.common.phone'),
                    class: "text-center"
                },
                idcard: {
                    label: this.$t('m.cloud.id_card'),
                    class: "text-center"
                },
                driveCheck: {
                    label: this.$t('m.cloud.drive_check'),
                    class: "text-center"
                },
                statusCheck: {
                    label: this.$t('m.cloud.verify_status'),
                    class: "text-center"
                },
                // point: {
                //     label: this.$t('m.cloud.appoint'),
                //     class: "text-center"
                // },
                dealership: {
                    label: this.$t('m.common.dealership'),
                    class: "text-center"
                },
                actions: {
                    label: this.$t('m.vehicle.actions'),
                    class: "Actions"
                }
            },
            table: null,
            currentPage: 1,
            pageSize: 10,
            total: 0,
            totalPages:0,
            showTip: false,
            curName: '',
            curAdminList: []
        }
    },
    mounted() {
        this.initData(this.currentPage, this.pageSize);
    },
    methods: {
        initData(page) {
            httpClient.get(`/api/v1/clouddrive/user/list?pageNo=${page}&pageSize=${this.pageSize}`).then(response => {
                this.total = response.data.data.rowCount;
                this.filterData(response.data.data);
                this.pageCount = response.data.data.totalPages;
            })
        },
        filterData(data) {
            this.table = data.datas.map(item => {
                return {
                    phone: item.phone,
                    idcardAuthStatus: item.idcardAuthStatus,
                    driverAuthStatus: item.driverAuthStatus,
                    checkStatus:item.checkStatus,
                    dealership: item.tenantName,
                    point:item.appointmentStatus,
                    userId:item.userId,
                }
            });
        },
        prevPage(){
            this.initData(this.currentPage > 1  ? this.currentPage - 1 : 1)
        },
        nextPage(){
            this.initData(this.currentPage >= this.pageCount  ? this.currentPage : this.currentPage + 1)
        },
        changePage(page) {
            this.initData(page);
        }
    }
}
